import React, { useEffect } from 'react'

import { v4 as uuidv4 } from 'uuid';

//data
import { data } from './../data'

//components
import FunctionIcon from './FunctionIcon';
import Cross from './Cross'

const FunctionUI = ({ leng, setDisplay, display, setActive }) => {
    setActive={setActive}
    // useEffect(() => {
    //     setTimeout(() => {
    //         setDisplay(false)
    //     }, 7000)
    // }, [setDisplay])

    return (
        <div
            className="function-container"
            style={{
                display: !display && "none"
            }} >
            <div className="function">{data[leng].function.function}</div>
            <div className="func-description">
                {data[leng].function.description.map(item =>
                    item !== "icon" ? <p
                    key = {uuidv4()}
                    >{item}</p> :
                        <FunctionIcon
                        key = {uuidv4()}
                        />)}

            </div>

            <div
                onClick={() => setDisplay(false)}>
                <Cross />
            </div>
        </div>
    )
}

export default FunctionUI;
